import React, { Component } from 'react';
import Train from './Train';

class ListeTrain extends Component {

    render() {
        let index = Math.floor(Math.random() * 100000)
        console.log(index)
        return (
            <Train key={index} data={this.props.data} />
        );

    }

}

export default ListeTrain;
